    true,nt"url": null,nt"notes": "This study is part of a larger FNS effort
    to ensure WIC program integrity and to comply with the Improper Payments Information
    Act of 2002 (IPIA) (Public Law 107-300), which requires FNS to estimate improper
    payments (IP) in its programs. To evaluate program integrity, the 2013 report includes
    two complementary studies: A study, comparable to the 1998 and 2005 WIC Vendor Management
    Studies, which examined purchases made through compliance buys using paper- or Electronic
    Benefit Transfer (EBT)-based FIs, and a cash value voucher study, which examined
    purchases made through compliance buys using the CVVs or, in the case of EBT, cash
